var blueScore = 0;
var redScore = 0;
var testString = "";
function matchDataNames() {
    testString = document.querySelector('#match-header-blue').textContent + document.querySelector('#match-header-red').textContent;

    if (testString.indexOf(" ⇒ ") !== -1 || testString.indexOf(" / ") !== -1) {

	    blueScore = blueScore = parseInt(document.querySelector('#match-header-blue').textContent.match(/\(\d\)/gi)[0].substring(1,2),10)
		redScore = parseInt(document.querySelector('#match-header-red').textContent.match(/\(\d\)/gi)[0].substring(1,2),10)
		blueScore = " (" + (blueScore).toString() + ")";
		redScore = " (" + (redScore).toString() + ")";

		blueNameString = document.querySelector('#match-header-blue').textContent;
		blueNameString = blueNameString.substring(blueNameString.search(/\S\S/gi), 1024)
		blueNameString = blueNameString.substring(4, blueNameString.search(/\s\s\s/gi))

	    redNameString = document.querySelector('#match-header-red').textContent;
		redNameString = redNameString.substring(redNameString.search(/\S\S/gi), 1024);
	    redNameString = redNameString.substring(0, redNameString.search(/\(\d\)/gi) - 1);


		if (blueNameString.indexOf(" ⇒ ") !== -1) {
		   splitter = " ⇒ ";
		   blueNameArray = blueNameString.split(" ⇒ ");
		} else if (blueNameString.indexOf(" / ") !== -1) {
		   splitter = "/";
		   blueNameArray = blueNameString.split(" / ");
		} else {
		   blueNameArray = [];
		   blueNameArray.push(blueNameString);
		   splitter = "";
		}

		for (var z = 0; z < blueNameArray.length; z += 1) {
		    blueNameArray[z] = preLink + characters[blueNameArray[z]] + "'>" + blueNameArray[z]
			if (z - blueNameArray.length !== -1) {
	            blueNameArray[z] += splitter
			}
			blueNameArray[z] += "</a>"
			if (z - blueNameArray.length !== -1) {
	            blueNameArray[z] += " "
			}
		}

		if (redNameString.indexOf(" ⇒ ") !== -1) {
		   splitter = " ⇒ ";
		   redNameArray = redNameString.split(" ⇒ ");
		} else if (redNameString.indexOf(" / ") !== -1) {
		   splitter = "/";
		   redNameArray = redNameString.split(" / ");
		} else {
		   redNameArray = [];
		   redNameArray.push(redNameString);
		   splitter = "";
		}

		for (var z = 0; z < redNameArray.length; z += 1) {
		    redNameArray[z] = preLink + characters[redNameArray[z]] + "'>" + redNameArray[z]
			if (z - redNameArray.length !== -1) {
	            redNameArray[z] += splitter
			}
			redNameArray[z] += "</a>"
			if (z - redNameArray.length !== -1) {
	            redNameArray[z] += " "
			}
		}

		document.querySelector('#match-header-blue').innerHTML = "";
		for (var z = 0; z < blueNameArray.length; z += 1) {
		    document.querySelector('#match-header-blue').innerHTML += blueNameArray[z];
		}
		document.querySelector('#match-header-blue').innerHTML += blueScore

		document.querySelector('#match-header-red').innerHTML = "";
		for (var z = 0; z < redNameArray.length; z += 1) {
		    document.querySelector('#match-header-red').innerHTML += redNameArray[z];
		}
		document.querySelector('#match-header-red').innerHTML += redScore
	}
}

